import React,{Component} from "react";

function ListProfils(props){
    return(
        <ul>
         <li>
         <img src = {props.p.img} alt={`icon of ${props.p.name}`}/>

          <label htmlFor={props.p.id} class="px-2">{props.p.name}</label><br/>
        </li>
        </ul>
    );}

    export default ListProfils ;
